import React from 'react';
import { signInWithGoogle } from './firebaseConfig'; // Assuming signInWithGoogle is exported from firebaseConfig.js or a similar file

const Login = () => {
  return (
    <div>
      <h1>Login</h1>
      <button onClick={signInWithGoogle}>Sign in with Google</button>
    </div>
  );
};

export default Login;
